import React from "react";

const CreateBlog = () => {
  return (
    <div className="create-blog">
      <p className="create-blog-title">Create New Blog</p>

      <form>
        <input type="text" placeholder="Title" />
      </form>
    </div>
  );
};

export default CreateBlog;
